import React, { Component } from "react"
import "./bucketList"

function bucketList(props) {
    const { universityName, url, country, action, onCardClick, addToBucket } = props || {}
    const actionLabel = action && action.label

    const bucketLists=JSON.parse(localStorage.getItem("bucket"));
    return (
        <div className="divider">
            {bucketLists && bucketLists.map((bucket,i) =>
                <div className="card flex col">
                    <div className="flex spaceBetween"> {bucket["universityName"]} </div>
                    <div className="marginTop"> {bucket["country"]} </div></div>

            )}
        </div>
    )
}
export default bucketList
